import React from 'react'
import './App.css';
import Doggie from './doggii';
import { BrowserRouter, Routes, Route } from "react-router-dom";
import SingleDog from './SingleDog';

const App = () => {
  return (
    <>
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<Doggie />}></Route>
          <div className='map'>
            <iframe src="https://www.google.com/maps/d/embed?mid=1P2sn6yfqGd5UGC29khq0sZbmqWfjp2k&ehbc=2E312F" width="1200"
              height="500"></iframe>
          </div>
          <Route path="/:name" element={<SingleDog />}></Route>
        </Routes>
      </BrowserRouter>
    </>
  );
}

export default App;
